INSERT INTO `summary` VALUES (1,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  The instructor taught about database design and the importance of having a good database. The instructor explained the different database structures, but I still feel like I don\'t fully understand. There are many parts that are still a mystery, making me feel insecure about my abilities.</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : The instructor taught about writing SQL. I tried to understand, but I still find it very difficult. Writing commands to retrieve data from the database is complex. I feel a little discouraged, but my classmates helped explain and encourage me, giving me the motivation to keep trying.</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : Today was a very stressful day because the instructor assigned homework on creating a database and writing SQL commands. I spent hours researching and experimenting, but the results were not what I expected. It made me feel drained and wonder if I could pass this course.</li>\n</ul>\n<p>2024-08-13</p>\n<ul> \n	<li>Study content : Today I met with the instructor to get advice on the homework I received. The instructor explained further and gave very helpful advice. I feel like I understand the material better. Although there are still some parts that are difficult, talking to the instructor gave me the motivation to not give up.</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>Try to find a study group or partner to help you understand the material better.</li>\n    <li>Practice writing SQL commands regularly to improve your skills.</li>\n    <li>Don\'t be afraid to ask for help from the instructor or classmates.</li>\n    <li>Take breaks when you feel overwhelmed and come back to the material with a fresh perspective.</li>\n    <li>Remember that everyone learns at their own pace, and it\'s okay to struggle sometimes.</li>\n','2024-08-13',11),(2,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  The instructor taught about database design and the importance of having a good database. The instructor explained the different database structures, but I still feel like I don\'t fully understand. There are many parts that are still a mystery, making me feel insecure about my abilities.</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : The instructor taught about writing SQL. I tried to understand, but I still find it very difficult. Writing commands to retrieve data from the database is complex. I feel a little discouraged, but my classmates helped explain and encourage me, giving me the motivation to keep trying.</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : Today was a very stressful day because the instructor assigned homework on creating a database and writing SQL commands. I spent hours researching and experimenting, but the results were not what I expected. It made me feel drained and wonder if I could pass this course.</li>\n</ul>\n<p>2024-08-13</p>\n<ul> \n	<li>Study content : Today I met with the instructor to get advice on the homework I received. The instructor explained further and gave very helpful advice. I feel like I understand the material better. Although there are still some parts that are difficult, talking to the instructor gave me the motivation to not give up.</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>Try to find a study group or partner to help you understand the material better.</li>\n    <li>Practice writing SQL commands regularly to improve your skills.</li>\n    <li>Don\'t be afraid to ask for help from the instructor or classmates.</li>\n    <li>Take breaks when you feel overwhelmed and come back to the material with a fresh perspective.</li>\n    <li>Remember that everyone learns at their own pace, and it\'s okay to struggle sometimes.</li>\n','2024-08-13',11),(3,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content : The instructor taught about database design and the importance of having a good database. The instructor explained the different database structures, but I still feel like I don\'t fully understand. There are many parts that are still a mystery, making me feel insecure about my abilities.</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : The instructor taught about writing SQL. I tried to understand, but I still find it very difficult. Writing commands to retrieve data from the database is complex. I feel a little discouraged, but my classmates helped explain and encourage me, giving me the motivation to keep trying.</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : Today was a very stressful day because the instructor assigned homework on creating a database and writing SQL commands. I spent hours researching and experimenting, but the results were not what I expected. It made me feel drained and wonder if I could pass this course.</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>Ask for help from the instructor or classmates.</li>\n    <li>Practice more with SQL commands.</li>\n    <li>Break down the homework into smaller tasks.</li>\n    <li>Take breaks when you feel overwhelmed.</li>\n    <li>Don\'t give up, keep trying!</li>\n','2024-08-13',11),(4,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  The second day of the database course was exciting and nerve-wracking. The lecture covered database design and the importance of a good database. The professor explained different database structures, but I still feel confused. There are many parts that are still a mystery, making me feel insecure about my abilities.</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : Today\'s lecture was about writing SQL. I tried to understand it, but it\'s still very difficult. Writing commands to retrieve data from the database is complex. I\'m a little discouraged, but my classmates helped explain and encourage me, giving me the motivation to keep trying.</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : Today was a very stressful day because the professor assigned homework on creating a database and writing SQL commands. I spent hours researching and experimenting, but the results were not what I expected. It made me feel drained and wonder if I can pass this course.</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>Ask for help from the professor or classmates.</li>\n    <li>Practice more with SQL commands.</li>\n    <li>Break down the homework into smaller tasks.</li>\n    <li>Take breaks and don\'t be afraid to ask for help.</li>\n    <li>Focus on understanding the concepts rather than just memorizing them.</li>\n','2024-08-13',11),(5,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  เรียนรู้เกี่ยวกับการออกแบบฐานข้อมูลและความสำคัญของการมีฐานข้อมูลที่ดี อาจารย์ได้อธิบายถึงโครงสร้างของฐานข้อมูลแบบต่างๆ แต่ยังไม่เข้าใจอย่างถ่องแท้</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : เรียนรู้การเขียน SQL แต่ยังรู้สึกว่ายากมาก การเขียนคำสั่งเพื่อดึงข้อมูลจากฐานข้อมูลนั้นซับซ้อน</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : รู้สึกเครียดมาก เพราะอาจารย์ให้ทำการบ้านเกี่ยวกับการสร้างฐานข้อมูลและการเขียนคำสั่ง SQL ใช้เวลาหลายชั่วโมงในการค้นคว้าและทดลองทำ แต่ผลลัพธ์กลับไม่เป็นอย่างที่หวัง</li>\n</ul>\n<p>2024-08-13</p>\n<ul> \n	<li>Study content : ไปพบกับอาจารย์เพื่อขอคำปรึกษาเกี่ยวกับการบ้านที่ได้รับ อาจารย์ได้อธิบายเพิ่มเติมและให้คำแนะนำที่เป็นประโยชน์มาก ทำให้เข้าใจเนื้อหามากขึ้น</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>ขอคำแนะนำเพิ่มเติมจากอาจารย์</li>\n    <li>ฝึกฝนการเขียน SQL เพิ่มเติม</li>\n    <li>ขอความช่วยเหลือจากเพื่อนๆ ในห้องเรียน</li>\n    <li>ค้นคว้าข้อมูลเพิ่มเติมจากแหล่งข้อมูลอื่นๆ</li>\n    <li>อย่าท้อแท้และพยายามอย่างต่อเนื่อง</li>\n','2024-08-13',11),(6,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  The second day of the database course was exciting and nerve-wracking. The lecture covered database design and the importance of a good database. The professor explained different database structures, but I still feel confused. There are many parts that are still a mystery, making me feel insecure about my abilities.</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : Today\'s lecture was about writing SQL. I tried to understand it, but it\'s still very difficult. Writing commands to retrieve data from the database is complex. I\'m a little discouraged, but my classmates helped explain and encourage me, giving me the motivation to keep trying.</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : Today was very stressful because the professor assigned homework on creating a database and writing SQL commands. I spent hours researching and experimenting, but the results were not what I expected. It made me feel exhausted and wonder if I can pass this course.</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>Ask for help from the professor or classmates.</li>\n    <li>Practice more with SQL commands.</li>\n    <li>Break down the homework into smaller tasks.</li>\n    <li>Take breaks and don\'t be afraid to ask for help.</li>\n    <li>Focus on understanding the concepts rather than just memorizing them.</li>\n','2024-08-13',11),(7,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content : วันนี้เป็นวันที่สองของการเรียนวิชาฐานข้อมูล ฉันรู้สึกตื่นเต้นและกังวลไปพร้อมๆ กัน เนื้อหาที่อาจารย์สอนเป็นเรื่องเกี่ยวกับการออกแบบฐานข้อมูลและความสำคัญของการมีฐานข้อมูลที่ดี อาจารย์ได้อธิบายถึงโครงสร้างของฐานข้อมูลแบบต่างๆ แต่ฉันกลับรู้สึกว่ายังไม่เข้าใจอย่างถ่องแท้ มีหลายส่วนที่ยังคงเป็นปริศนา ทำให้ฉันรู้สึกไม่มั่นใจในความสามารถของตัวเอง</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : วันนี้อาจารย์ได้สอนเรื่องการเขียน SQL ฉันพยายามทำความเข้าใจแต่ยังรู้สึกว่ายากมาก การเขียนคำสั่งเพื่อดึงข้อมูลจากฐานข้อมูลนั้นซับซ้อน ฉันรู้สึกท้อแท้เล็กน้อย แต่เพื่อนๆ ในห้องเรียนก็คอยช่วยกันอธิบายและให้กำลังใจ ทำให้ฉันมีกำลังใจที่จะพยายามต่อไป</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>ลองฝึกเขียน SQL เพิ่มเติม</li>\n    <li>ขอคำแนะนำจากอาจารย์หรือเพื่อนๆ</li>\n    <li>ศึกษาเพิ่มเติมจากแหล่งข้อมูลอื่นๆ</li>\n    <li>อย่าท้อแท้และพยายามต่อไป</li>\n    <li>เชื่อมั่นในตัวเอง</li>\n','2024-08-13',11),(8,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  เรียนรู้เกี่ยวกับการออกแบบฐานข้อมูลและความสำคัญของการมีฐานข้อมูลที่ดี อาจารย์ได้อธิบายถึงโครงสร้างของฐานข้อมูลแบบต่างๆ แต่ยังไม่เข้าใจอย่างถ่องแท้</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : เรียนรู้การเขียน SQL แต่ยังรู้สึกว่ายากมาก การเขียนคำสั่งเพื่อดึงข้อมูลจากฐานข้อมูลนั้นซับซ้อน</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : รู้สึกเครียดมาก เพราะอาจารย์ให้ทำการบ้านเกี่ยวกับการสร้างฐานข้อมูลและการเขียนคำสั่ง SQL ใช้เวลาหลายชั่วโมงในการค้นคว้าและทดลองทำ แต่ผลลัพธ์กลับไม่เป็นอย่างที่หวัง</li>\n</ul>\n<p>2024-08-13</p>\n<ul> \n	<li>Study content : ไปพบกับอาจารย์เพื่อขอคำปรึกษาเกี่ยวกับการบ้านที่ได้รับ อาจารย์ได้อธิบายเพิ่มเติมและให้คำแนะนำที่เป็นประโยชน์มาก ทำให้เข้าใจเนื้อหามากขึ้น</li>\n</ul>\n\n<h2>Suggestion</h2>\n    <li>ขอคำแนะนำเพิ่มเติมจากอาจารย์</li>\n    <li>ฝึกฝนการเขียน SQL เพิ่มเติม</li>\n    <li>ขอความช่วยเหลือจากเพื่อนๆ ในห้องเรียน</li>\n    <li>ค้นคว้าข้อมูลเพิ่มเติมจากแหล่งข้อมูลอื่นๆ</li>\n    <li>อย่าท้อแท้และพยายามอย่างต่อเนื่อง</li>\n','2024-08-13',11),(9,'<h1> Summarize note </h1>\n<p>2024-08-10</p>\n<ul> \n	<li>Study content :  เรียนรู้เกี่ยวกับการออกแบบฐานข้อมูลและความสำคัญของการมีฐานข้อมูลที่ดี อาจารย์ได้อธิบายถึงโครงสร้างของฐานข้อมูลแบบต่างๆ แต่ยังไม่เข้าใจอย่างถ่องแท้</li>\n</ul>\n<p>2024-08-11</p>\n<ul> \n	<li>Study content : เรียนรู้การเขียน SQL แต่ยังรู้สึกว่ายากมาก การเขียนคำสั่งเพื่อดึงข้อมูลจากฐานข้อมูลนั้นซับซ้อน</li>\n</ul>\n<p>2024-08-12</p>\n<ul> \n	<li>Study content : รู้สึกเครียดมาก เพราะอาจารย์ให้ทำการบ้านเกี่ยวกับการสร้างฐานข้อมูลและการเขียนคำสั่ง SQL ใช้เวลาหลายชั่วโมงในการค้นคว้าและทดลองทำ แต่ผลลัพธ์กลับไม่เป็นอย่างที่หวัง</li>\n</ul>\n<p>2024-08-13</p>\n<ul> \n	<li>Study content : ไปพบกับอาจารย์เพื่อขอคำปรึกษาเกี่ยวกั